    cell size. The data provide an estimate of annual average wind speed at 90 meter
    height above surface for specific offshore regions of the United States.  To learn
    more, please see the [Assessment of Offshore Wind Energy Resources for the United
    States](http://nrelpubs.nrel.gov/WebtopSecure/ws/nich/int/nrel/Record?rpp=25&upp=0&m=3&w=NATIVE%28%27AUTHOR+ph+words+%27%27Heimiller%27%27%27%29&order=native%28%27pubyear%2FDescend%27%29
    "NREL Publication").rnrnThese data were produced in cooperation with U.S. Department
    of Energy, and have been validated by NREL. To download state wind resource maps,
    visit [Wind Powering America](http://www.windpoweringamerica.gov/windmaps/offshore.asp).rnrnIn
    order to ensure the downloadable shapefile is current, please compare the date updated
    on this page to the last updated date on the [NREL GIS Wind Data](http://www.nrel.gov/gis/data_wind.html
